(()=>{const e=document.getElementById("buttonInstall");let t;window.addEventListener("beforeinstallprompt",(e=>{e.preventDefault(),t=e})),e.addEventListener("click",(async()=>{t&&(t.prompt(),t.userChoice.then((e=>{"accepted"===e.outcome&&console.log("Accepted install prompt"),console.log("Rejected install prompt")})))})),window.addEventListener("appinstalled",(e=>{console.log("App Installed!")}))})();